CREATE FUNCTION public.osc_workflow_changes() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
   data jsonb;
   tmp TEXT;
   value TEXT;
BEGIN
   data := cast(NEW.data as jsonb);
    
   value := data#>>'{mandatory_public_fields,title}';
   value := value || ' ';
   value := value || coalesce(data#>>'{mandatory_public_fields,description}','');


   FOR tmp IN SELECT jsonb_array_elements(data#>'{public_fields,osc_datasets}')
     LOOP
        value := value ||  ' ' || coalesce((tmp::jsonb)->>'title','');
     END LOOP;
   
   FOR tmp IN SELECT jsonb_array_elements(data#>'{public_fields,osc_datasets}')
     LOOP
        value := value ||  ' ' || coalesce((tmp::jsonb)->>'description','');
     END LOOP;
     
   FOR tmp IN SELECT jsonb_array_elements(data#>'{public_fields,github_repos}') 
     LOOP
      value := value ||  ' ' || coalesce((tmp::jsonb)->>'description','');
     END LOOP;  
   
   RAISE NOTICE 'value: %', value; 
   NEW.ts_vector = to_tsvector(value);
   RETURN NEW;
END;
$$;


